import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import CategoriBox from "../UI/CategoriBox";
import Footer from "../Components/Footer";

import "../fonts/fonts.css";
import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const Dyson = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        style={{
          background: "url(images/sub_dyson_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      >
        <SubPortfolioInfo />

        <SiteButton
          className={classes.composeBtn}
          btnColor="#71ab4d"
          textColor="#ffffff"
          width="150px"
          top="760px"
          left="370px"
          link="dyson/index.html"
        />
      </div>

      <section className={classes2.subInfo}>
        <div className={classes2.subInfoContent}>
          <div
            className={classes2.infoTitle}
            style={{ margin: "0 auto", paddingTop: "180px" }}
          >
            <div
              className={classes2.infoLogo}
              style={{
                width: "218px",
                height: "45px",
                margin: "0 auto",
                background: "url(images/logo_nespresso.png) no-repeat",
              }}
            ></div>
            <p
              style={{ textAlign: "center", marginTop: "38px", color: "#222" }}
            >
              다이슨은 1993년, 제임스 다이슨이 설립한 영국의 가전제품
              기업입니다.
              <br />
              세계 최초로 먼지봉투가 필요없는 백시르타입 진공청소기를 출시하며
              21세기 가전제품을 트렌드에
              <br />큰 영향을 준 회사로 평가됩니다.
            </p>
          </div>
        </div>
      </section>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#71ab4d"
        textColor="#ffffff"
        width="452px"
        top="6390px"
        link="dyson/index.html"
        left="50%"
        transX="-50%"
      />

      <Footer footerTop="6500px" />
      {/* <img src="images/dyson.png" alt="다이슨" /> */}
    </div>
  );
};

export default Dyson;
